import React from "react";
import axios from 'axios';
import { useParams } from 'react-router-dom';

const getMetarData = async (icao_code) => {
    const options = {
        url: `http://localhost:4000/metar?icao=${icao_code}`,
        method: "GET"
    }
    axios(options)
    .then(function (response) {
        console.log(`Sent user Metar data of ${icao_code.toUpperCase()}`);
        console.log(response.data);
    })
    .catch(function (err) { console.log(err); })
};


function Airport() {
    let params = useParams();
    return (
        <h1>Your Airport is: {params.airport.toUpperCase()}</h1>
    );
}


export default Airport;
